import{GET_CLUBS, ADD_CLUB, DELETE_CLUB} from './types';

export const getClubs = () => {
    return {
        type: GET_CLUBS
    };
};

export const DeleteClubs = () => {
    return {
        type: DELETE_CLUB
    };
};
